INSERT INTO `description` VALUES (1,'GB','hasCar',NULL,'Je suis une nouvelle version de la table pour tester','need',2),(2,'GB','hasBike',NULL,'Je suis une nouvelle version de la table pour tester','need',3),(3,'FR','recycleTrash',NULL,'Je suis une nouvelle version de la table pour tester','need',4),(4,'FR','publicTransports',NULL,'Je suis une nouvelle version de la table pour tester','need',5),(5,'FR','aVelo',NULL,'Je suis une nouvelle version de la table pour tester','need',3),(131,'GB','No plastic bags anymore','NoPlastic','The next time you go to a store to do your shopping, don\'t take plastic bags anymore! The best solution: do your shopping with a foldable eco-bag to make it more practical to carry.','challenge',40),(132,'FR','Plus de sac plastique','NonPlastique','La prochaine fois que vous vous rendez dans un magasin pour faire vos courses, ne prenez plus de sacs plastiques ! La meilleure solution : faire ses courses avec un sac-éco pliable pour que ce soit plus pratique à transporter.','challenge',40),(134,'GB','Limit energy consumption','LimitEnergy','First of all, limiting your energy consumption is, in addition to being an ecological gesture, a gesture that is good for your wallet. So we organize a little hunt at home for standby devices, turn down the heat when we\'re not there, turn off when we leave the room.','advice',4),(135,'FR','Limiter conso énergie','LimiterEnergie.','Tout d’abord limiter sa consommation d’énergie est, en plus d’être un geste écolo, un geste qui fait du bien au porte-monnaie alors on organise à la maison une petite chasse aux appareils en veille, on baisse le chauffage quand on est pas là, on éteint encore on quitte la salle.','advice',4),(136,'GB','Water consumption','LimitWater','Another gesture that is good for the wallet is to limit its water consumption. I cannot encourage you not to wash yourself, but for example to turn off the tap while washing your hands, to use the vegetable rinsing water to water the plants.','advice',5),(137,'FR','Limiter consommation eau','LimiterEau','Autre geste qui fait du bien au porte-monnaie limiter sa consommation d’eau je ne peux pas vous encourager à ne pas vous laver mais par exemple d’éteindre le robinet pendant qu’on se lave les mains, d’utiliser l’eau de rinçage des légumes pour arroser les plantes.','advice',5),(138,'GB','Careful wastes','CarefulWastes','Not at all glamorous certainly, waste is also small poisons for the planet. We first do everything to limit them, for example when we hesitate between two products in the supermarket we choose the least packed, then, when throwing out our waste, we check that we are not using the wrong bin and we do our small selective sorting mission.','advice',6),(139,'FR','Attention déchets','AttentionDechets','Pas du tout de glamour certes, les déchets sont aussi des petits poisons pour la planète. On fait d’abord tout pour les limiter, par exemple quand on hésite entre deux produits au supermarché on choisit le moins emballé, puis, au moment de jeter nos déchets, on vérifie qu’on ne se trompe pas de poubelle et on fait notre petite mission de tri sélectif.','advice',6),(140,'GB','Control purchases','ControlPurchases','The most difficult thing is also to reason with ourselves when we buy our little pleasures. Our things that we like: clothes, high-tech, books, cosmetics, accessories, ... Here too, to be green, you have to be reasonable and realize that our purchases come with their \"ecological burden\".','advice',7),(141,'FR','Maîtriser ses achats','MaitriserAchats','Le plus difficile, c’est aussi de se raisonner quand on achète nos plaisirs. Les trucs qui nous plaisent à nous : les fringues, l’Itech, les livres… Là aussi, pour être écolo, il faut être raisonnable et prendre conscience que nos achats arrivent avec leur fardeaux écologiques','advice',7),(142,'GB','Sensitize your childrens','SensitizeChildrens','It also seems important to me to note that the dissemination of good gestures and our little tips is also essential, for example to our children.','advice',8),(143,'FR','Sensibiliser nos enfants','SensibiliserEnfants','Il semble également important de noter que la diffusion des bons gestes et de nos petits trucs à nous est aussi essentiel, par exemple à nos enfants.','advice',8),(144,'FR','Prochain repas bio','MangerBio','Pour votre prochain repas, faites l’effort de manger bio et local. Manger bio et local vous permettra de limiter votre empreinte écologique et de se nourrir de manière plus saine et plus éthique.','challenge',41),(145,'GB','Organic meal','OrganicMeal','During your next meal, force yourself to eat organic and local. This will allow you to limit your ecological footprint and eat in a healthier and more ethical way.','challenge',41),(146,'GB','Refuse straw fast-food','RefuseStraw','The next time you go to a fast food restaurant, don\'t forget to refuse the straw offered by the cashier.','challenge',42),(147,'FR','Refuser paille fast-food','RefusePaille','La prochaine fois que vous allez au fast-food, n’oubliez pas de refuser la paille qu’offrera l’hôtesse de caisse.','challenge',42),(148,'GB','Doggy bag restaurant','DoggyRestaurant','The next time you\'re heading out to a restaurant and you\'re not finishing your meal, consider asking your server to make a doggy bag with the leftovers. Make a habit of doing it.','challenge',43),(149,'FR','Doggy bag restau','DoggyRestau','La prochaine fois que vous vous rendez au restaurant et que vous ne finissez pas votre repas pensez à demander à votre serveur de vous faire un doggy bag avec le reste de votre repas pour le consommer plus tard. Prenez l’habitude de le faire.','challenge',43),(150,'FR','Refuser publicité','RefuserPublicite','Collez une étiquette stop pub sur votre boîte aux lettres pour remporter ce challenge.','challenge',44),(151,'GB','Refuse all advertising','RefuseAdvertising','Stick an advertising stop label on your box letter to win this challenge.','challenge',44),(156,'GB','fag cleaning','Cigarrettes butts cleaning','It\'s not that we don\'t like smokers, but leaving cigarette ends on the floor is not a solution.','event',40),(157,'FR','Ramassage de mégots','ramassage de mégots','Ce n’est pas qu’on aime pas les fumeurs, mais laisser les mégots par terre n’est pas une solution.','event',40),(158,'GB','Climate conference','ClimateConference','The association \"Sauver mon dauphin Flipper\" invites you to its head office for a series of ecological conferences. The day will start at 9 a.m. and end at 2 a.m. for the more adventurous with a late aperitif.','event',41),(159,'FR','Conférence climatique','ConferenceClimatique','L’association « Sauver Mont-Dauphin flipper vous invite dans son siège social pour une série de conférences écologiques. La journée commencera à 9h et finira à 2h du matin pour les plus téméraires avec un apéritif tardif.','event',41);
